import collegeLogo from './JohnHopkinsLogo.png';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <img src={collegeLogo}></img>
      <h3 class="bar-item">Recruitment</h3>
      <a href="#" class="w3-bar-item w3-button">Campaigns</a>
      <a href="#" class="w3-bar-item w3-button">Discover</a>
      <a href="#" class="w3-bar-item w3-button">Social Tools</a>
      <a href="#" class="w3-bar-item w3-button">Criteria</a>
      <h3 class="bar-item">Engagement</h3>
      <a href="#" class="w3-bar-item w3-button">Connect</a>
      <a href="#" class="w3-bar-item w3-button">Library</a>
      <a href="#" class="w3-bar-item w3-button">Analytics</a>
      <h3 class="bar-item">Enrollment</h3>
      <a href="#" class="w3-bar-item w3-button">Students</a>
    </div>
  );
}

export default Sidebar;
